import React from "react";
import classes from "./Footer.module.css";

let Footer = (props) => {
    return(
        <footer className={classes.footer}>
            Проект выполнен digital-студией HeadGo совместно с компанией-производителем PRETTL-NK
        </footer>
    )
}

export default Footer;
